import React from "react";
// import { Container } from "reactstrap";
import "./signup.css";
import { Col, Row, Form, Card, InputGroup, Container } from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faAngleLeft,
  faEnvelope,
  faUnlockAlt,
} from "@fortawesome/free-solid-svg-icons";
import { Link, useHistory } from "react-router-dom";

const Signup = () => {
  const history = useHistory();

  const scholar_profile = () => {
    history.push("/scholar/profile");
  };

  return (
    <>
      <header className="header">
        <Container>
          <div className="navigation d-flex align-items-center justify-content-between">
            <div className="logo mt-3">
              <h2 className=" d-flex align-items-center gap-1">
                <i class="ri-pantone-line"></i> ResearchNet
              </h2>
            </div>
          </div>
        </Container>
      </header>

      <section className="d-flex align-items-center login">
        <Container>
          <p className="text-center">
            {/* <Card.Link
              className="text-muted"
              //   as={Link}
              //   to={Routes.Landing.path}
            >
              <FontAwesomeIcon icon={faAngleLeft} className="me-2" /> Back to
              homepage
            </Card.Link> */}
          </p>
          <Row className="justify-content-center">
            <Col
              xs={12}
              md={6}
              xl={6}
              className="d-flex align-items-center justify-content-center"
            >
              <div className="bg-light shadow shadow-soft border border-light p-4 p-lg-5 w-100 fmxw-500">
                <div className="text-center text-md-center mb-4 mt-md-0">
                  <h3 className="mb-0">Sign in</h3>
                </div>
                {/* onSubmit={(e) => handleSubmit(e)} */}
                <Form className="mt-4">
                  <Form.Group id="email" className="mb-4">
                    <Form.Label>Your Email</Form.Label>
                    <InputGroup>
                      <InputGroup.Text>
                        <FontAwesomeIcon icon={faEnvelope} />
                      </InputGroup.Text>
                      <Form.Control
                        name="Email"
                        autoFocus
                        required
                        type="email"
                        placeholder="example@scholar.com"
                        // onChange={(e) => setemail(e.target.value)}
                      />
                    </InputGroup>
                  </Form.Group>

                  <Form.Group>
                    <Form.Group id="password" className="mb-4">
                      <Form.Label>Your Password</Form.Label>
                      <InputGroup>
                        <InputGroup.Text>
                          <FontAwesomeIcon icon={faUnlockAlt} />
                        </InputGroup.Text>
                        <Form.Control
                          name="Password"
                          required
                          type="password"
                          placeholder="Password"
                          //   onChange={(e) => setpassword(e.target.value)}
                        />
                      </InputGroup>
                    </Form.Group>
                    <div className="d-flex justify-content-between align-items-center mb-4">
                      <Form.Check type="checkbox">
                        <Form.Label className="mb-0 text-danger"></Form.Label>
                      </Form.Check>
                      <Link
                        to="/scholar/forgot"
                        className="small text-end fw-bold aa"
                      >
                        Forgot your password?
                      </Link>
                    </div>
                  </Form.Group>

                  <Row className="justify-content-center align-items-center">
                    <button
                      className="btn w-50"
                      type="submit"
                      onClick={scholar_profile}
                    >
                      Sign in
                    </button>
                  </Row>
                </Form>

                <div className="d-flex justify-content-center align-items-center mt-4">
                  <span className="fw-normal">
                    Not registered?{" "}
                    <Link to="/scholar/signup" className="fw-bold aa">
                      Create account
                    </Link>
                    {/* <Card.Link
                      className="fw-bold"
                        as={Link}
                        to={Routes.Signup.path}
                    >
                      {`Create account`}
                    </Card.Link> */}
                  </span>
                </div>
              </div>
            </Col>
          </Row>
        </Container>
      </section>
    </>
  );
};

export default Signup;




